var currentSongId = 0;
function listener(event) {
    if(event.origin != event.data.referrer) return;
    /* when auto paused player */
    if (event.data.action == 'stopMusic') {
        if (player.getState() == 'playing') {
            player.pause();
        }
    }
    var iframes = document.getElementsByName('embedSong');
    currentSongId = event.data.currentSongId == undefined ? currentSongId : event.data.currentSongId;
    $.each(iframes, function(key, iframe){
        iframe.contentWindow.postMessage(currentSongId, event.data.referrer);
    });
}

if (window.addEventListener) {
    window.addEventListener("message", listener);
} else {
    // IE8
    window.attachEvent("onmessage", listener);
}

